import Login from './components/Auth/Login.tsx';
import Home from './components/Home.tsx';
import './styles.css';

export default function App() {
  const isAuthenticated = false;

  return (
    <>
      <Layout></Layout>
      <Routes>
          {!isAuthenticated ? <Redirect to="/login" /> : <Route path="/" element={<Home/>}/>}
      </Routes>
      
    </>


  );
}
